package day1;

public class ExampleSwitch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int Z = 4;
		
		switch (Z) {
		case 5:
			System.out.println("Value is Five");
			break;

		default:
			System.out.println("No Value");
			break;
		}
		
		
	}

}
